import React from 'react';
import PropTypes from 'prop-types';
import {
  PokemonCard,
  PokemonCardContent,
  PokemonCardFooter,
  PokemonCardMedia,
  PokemonCardBody,
  // ButtonInfo,
  Typographys,
} from './MaterialCardStyle';
import Grid from '@material-ui/core/Grid';

const MaterialCard = ({
    pokemons,
}) => (
  <Grid container>
    {
      pokemons.map(item => (
        item.pokemon.map(pokemon => (
          <Grid item xs={3} key={pokemon.id}>
            <PokemonCard>
                <PokemonCardContent>
    
                <PokemonCardMedia
                  style={{ height: 'auto', width: '100'}}
                  src={pokemon.sprites.front_shiny}
                />

                <PokemonCardBody>
                  <Typographys gutterBottom variant="h5" component="h2">
                    {pokemon.name}
                  </Typographys>
                </PokemonCardBody>
              </PokemonCardContent>
              <PokemonCardFooter />
            </PokemonCard>
          </Grid>
        ))
      )) 
    }

  </Grid>
);

MaterialCard.propTypes = {
  pokemons: PropTypes.array,
}

export default MaterialCard;
